// src/pages/Registro.js
import React from 'react';
import { useNavigate } from 'react-router-dom'; // Importamos el hook useNavigate
import './Home.css'; // Reutilizamos el mismo CSS

function Registro() {
  const navigate = useNavigate(); // Definimos navigate

  const handleRegister = () => {
    // Lógica de registro si la tienes (API, validaciones, etc.)
    navigate('/home'); // Redirige al usuario a /home después de registrarse
  };

  return (
    <div className="home-container">
      <img src="path/to/your/logo.png" alt="Logo" className="logo" /> {/* Aquí el logo PNG */}
      <div className="content">
        <h2>Bienvenido a My Chess Fantasy</h2>
        <button className="create-account-btn" onClick={handleRegister}>Crear Cuenta</button>
        <p className="login-text">Ya tengo cuenta</p>
      </div>
    </div>
  );
}

export default Registro;
